for(key in myObject) {
  if(key === colorKey) alert('A ' + myObject[key] + ' Car');  // ==> "A red Car"
}

Cat.prototype.hello = function() { this.say_(); }; // ==> 'hello' compiled to 'a', but also exported as 'hello'
Cat.prototype.say_ = function() {
  alert(H.lang.propertyNameByValue(this, arguments.callee.caller) // ==> 'hello'
};

H.Foo.prototype.bar = function(array, idx) {
  if(idx < 0) throw new H.lang.InvalidArgumentError(
    H.Foo.prototype.bar, 2, 'less then  0');
}
new H.Foo().bar([], -4711); // ==> 'Invalid Argument: H.Foo#bar "idx" (-4711) less then 0

Foo.prototype.bar = function() {
  if(this.isDisposed()) {
    throw new H.lang.IllegalOperationError(H.Foo.prototype.bar, 'Instance already disposed');
  }
}

H.Foo.prototype.bar = function(array, idx) {
  if(idx < 0) throw new H.lang.OutOfRangeError(
    H.Foo.prototype.bar, 2, 0, array.length - 1);
}
new H.Foo().bar([0, 1], -4); // ==> 'OutOfrange: H.Foo#bar (-4 out of [0...1])

//---------------------------------
//a simple example
//---------------------------------
var additionQueue = new H.util.AsyncQueue(3, function(task, data) {
  //process data
  var operandA = data.operandA,
      operandB = data.operandB,
      result = operandA + operandB;
  //call task.done
  task.done(result);
});

//push tasks with data to process
additionQueue.push({
   operandA: 1,
   operandB: 1
}, function(task, result, opt_error) { console.log(result); });

//---------------------------------
//an example with an error
//---------------------------------
var divisionQueue = new H.util.AsyncQueue(3, function(task, data) {
  //process data
  var operandA = data.operandA,
      operandB = data.operandB;
  if(operandB === 0) {
    //call task.done with an error message
    task.done(null, 'Division by zero!');
  }
  else {
    result = operandA / operandB;
    //call task.done
    task.done(result);
  }
});
//push tasks with data to process
divisionQueue.push({
   operandA: 1,
   operandB: 0
}, function(task, result, opt_error) {
  if(opt_error) console.log("Oh noes: ", opt_error);
  else console.log("Yay: ", result);
});

