prose.p:
The function to be called once the request finished. It gets the response text and an optional error type as arguments. Possible error types are:
undefined - if no error occurred
"abort" - if the request was explicit aborted {@see H.net.Xhr.prototype.abort}}
"timeout" - if the request timed out {@see H.net.Xhr.Options#timeout}
"network" - if a NetworkError occurred
"cors" - if the cross origin request can not be made
